import React, { useEffect, useState } from "react";

export default function Users() {
  const [users, setUsers] = useState([]);
  const [form, setForm] = useState({ nom: "", prenom: "", type: "", email: "" });

  const API_URL = "http://localhost:3000/api/utilisateurs"; // Change ici si besoin

  const charger = () => {
    fetch(API_URL)
      .then(res => res.json())
      .then(data => setUsers(data));
  };

  useEffect(() => {
    charger();
  }, []);

  const supprimer = (id) => {
    fetch(`${API_URL}/${id}`, { method: "DELETE" })
      .then(() => charger());
  };

  const ajouter = (e) => {
    e.preventDefault();
    fetch(API_URL, {
      method: "POST",
      headers: { "Content-Type": "application/json" },
      body: JSON.stringify(form)
    }).then(() => {
      setForm({ nom: "", prenom: "", type: "", email: "" });
      charger();
    });
  };

  return (
    <div className="container mt-4">
      <h2>Gestion des utilisateurs</h2>
      <table className="table table-bordered">
        <thead>
          <tr>
            <th>Nom</th>
            <th>Prénom</th>
            <th>Type</th>
            <th>Email</th>
            <th>Actions</th>
          </tr>
        </thead>
        <tbody>
          {users.map(u => (
            <tr key={u.id}>
              <td>{u.nom}</td>
              <td>{u.prenom}</td>
              <td>{u.type}</td>
              <td>{u.email}</td>
              <td>
                <button className="btn btn-danger btn-sm" onClick={() => supprimer(u.id)}>Supprimer</button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>

      <h3>Ajouter un utilisateur</h3>
      <form onSubmit={ajouter}>
        <div className="row">
          <div className="col">
            <input className="form-control mb-2" placeholder="Nom" value={form.nom} onChange={e => setForm({...form, nom: e.target.value})} required />
          </div>
          <div className="col">
            <input className="form-control mb-2" placeholder="Prénom" value={form.prenom} onChange={e => setForm({...form, prenom: e.target.value})} required />
          </div>
          <div className="col">
            <input className="form-control mb-2" placeholder="Type (eleve/prof/invite)" value={form.type} onChange={e => setForm({...form, type: e.target.value})} required />
          </div>
          <div className="col">
            <input className="form-control mb-2" placeholder="Email" value={form.email} onChange={e => setForm({...form, email: e.target.value})} />
          </div>
          <div className="col">
            <button className="btn btn-primary w-100">Ajouter</button>
          </div>
        </div>
      </form>
    </div>
  );
}
